import Card from "../UI/Card";
import classes from "./Cart.module.css";
import CartItem from "./CartItem";
import { useSelector } from "react-redux";
import { Fragment } from "react";

const Cart = (props) => {
  const cardVis = useSelector((state) => state.cartVis);
  const testEx = useSelector((state) => state.testEx);
  const bookEx = useSelector((state) => state.bookEx);
  const dvdEx = useSelector((state) => state.dvdEx);
  const cartContent = useSelector((state) => state.cartContent);
  return (
    <Fragment>
      {cardVis && (
        <Card className={classes.cart}>
          <h2>Your Shopping Cart</h2>
          <ul>
            {/* {testEx && (
              <CartItem
                item={{ title: "Test Item", quantity: 3, total: 18, price: 6 }}
              />
            )} */}
            {cartContent.map((el) => 
              <CartItem item={el} key={el.id}></CartItem>
            )}
          </ul>
        </Card>
      )}
    </Fragment>
  );
};

export default Cart;
